import logo from './logo.svg';
import './App.css';
import Nav from './components/nav'
import Banner from './components/banner'
import About from './components/about'
import Skills from './components/skills';


function App() {
  return (
    <div className="App">
      <Nav />
      <Banner />
      <About />
      <Skills />
    </div>
  );
}

export default App;
